import React, { Component } from 'react';
import './Memo.css';

export default class Memo extends Component {
    state = {memoTitle: "memo1", memoContent: "memoContent1", MemoVideoTime: 191}
    render() {
        let _onClickMemoVideoTime = (e) => {
            e.preventDefault();
            const memoList = document.getElementById("memoList")
            if(memoList.value !== "")
                memoList.value.seekTo(191);
        }

        return(
            <div className="Memo">
              <div className="MemoTitle">memo1</div>
              <div className="MemoDescc">memoContent1</div>
              <a href="/content" className="MemoVideoTime" onClick={_onClickMemoVideoTime} value={this.state.MemoVideoTime}>
                  <div >{`${Number.parseInt(this.state.MemoVideoTime/60)}:${this.state.MemoVideoTime%60}`}</div>
            </a>
            </div>
        )
    }
}
